import React from 'react';
import url from '../api/index.json';


const Answer = () => {

const data  = url.answer;

const response = data.map((item,index)=>{
    return(<p key={index.id1}>{item.id1}</p>)
})

const inputs = [["Male", "M"], ["Female", "F"], ["Other", "O"]]
  

console.log('response', response);
return (
    <div>
      {
        inputs.map(([text, value], i) => (
	  <div key={ i }>
	    <input type="radio"
             checked
	     
	     value={ value } /> 
    	    { text }
          </div>
        ))
      }
    </div>
)
};

export default Answer;
